import { Component } from '@angular/core';
import { delay, from, take } from 'rxjs';
import { CellService } from 'src/app/services/cell.service';
import { GridService } from 'src/app/services/grid.service';

@Component({
  selector: 'gol-header',
  templateUrl: './gol-header.component.html',
  styleUrls: ['./gol-header.component.scss']
})
export class GolHeaderComponent {
  iterations: number = 100;

  constructor(
    private readonly cellService: CellService,
    private readonly gridService: GridService,
  ) { }

  startGame(): void {    
    this.gridService.getCells().forEach(cell => {
      cell.isAlive = this.cellService.getCellSurvivalRules(cell) === 'alive' ? true : false;
    });

    this.iterations--;
    console.count()

    setTimeout(() => {
     this.iterations > 0 && this.startGame();
    }, 500)
  }
}
